package pl.krkteam.battleships.page.registerimport org.openqa.selenium.WebDriverimport pl.krkteam.battleships.web.Clickerimport pl.krkteam.battleships.web.script.InputFillerobject PlayerRegistration {    fun provideNameAndGoToRooms(webDriver: WebDriver) {        val inputClassName = "mat-input-element"        InputFiller.clearInputElement(webDriver, inputClassName)        InputFiller.fillInputElement(webDriver, inputClassName, "seleniumPlayer")        Clicker.clickOn(webDriver,"mat-button-toggle-label-content",0)    }}